// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "./MinerMinter.sol";

contract MinerUpgrader {

    modifier minerExists(address _addr, uint256 _minerId) {
        MinerMinter mm = MinerMinter(_addr);
        require(mm.getMiner(_minerId).minerId > 0);
        _;
    }

    function upgradeMiningLevel(address _addr, uint256 _minerId) public minerExists(_addr, _minerId) {
        MinerMinter mm = MinerMinter(_addr);
        uint256 currentLevel = mm.getMiner(_minerId).miningLevel;
        setMiningLevel(mm, _minerId, currentLevel + 1);
        // upgrade mining power
    }

    function upgradeCapacityLevel(address _addr, uint256 _minerId) public minerExists(_addr, _minerId) {
        MinerMinter mm = MinerMinter(_addr);
        uint256 currentLevel = mm.getMiner(_minerId).capacityLevel;
        setCapacityLevel(mm, _minerId, currentLevel + 1);
        // upgrade coal, iron, silver capacity
    }


    function setMiningLevel(MinerMinter mm, uint256 _minerId, uint256 level) private {
        mm.setMiningLevel(_minerId, level);
    }

    function setCapacityLevel(MinerMinter mm, uint256 _minerId, uint256 level) private {
        mm.setCapacityLevel(_minerId, level);
    }
}
